def sql_thread(times):
    last_time = int(time.time())
    while True:
        time.sleep(30)
        seleninm.sql_update(times)
        if stop_threads:
            if not seleninm.db.is_closed():
                seleninm.db.close()
            break
        if int(time.time()) - last_time > 1800:
            last_time = int(time.time())
            if not seleninm.db.is_closed():
                seleninm.db.close()


